(2, 'Welcome Party', '/uploads/attachment/20210330/305500f66dfb92b01f47de891736d64f.jpg', '【MCSA迎新派对】是“牛”人就来最“牛”的趴', '<section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">Welcome party一直是MCSA的传统热门活动，大家积极的参与活动，享受欢乐结交新的朋友。快乐，是我们活动的宗旨。</p></section><p>MCSA迎新从不吝啬，这学期我们也带着重磅福利献给大家！</p><p>Zoom大学也不要怕，我们的热情可以拯救孤寡的你！</p><section><section></section></section><p><span style=\"font-size: 15px; caret-color: rgb(160, 160, 160); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; letter-spacing: 1.7999999523162842px;\">我们有</span><strong style=\"font-size: 15px; caret-color: rgb(160, 160, 160); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; letter-spacing: 1.7999999523162842px; margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(90, 37, 7); font-size: 16px; box-sizing: border-box !important; word-wrap: break-word !important;\">team leader</span></strong><span style=\"font-size: 15px; caret-color: rgb(160, 160, 160); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; letter-spacing: 1.7999999523162842px;\">气氛组，摆脱社恐！我们有看图猜词，东问西答等花式小游戏，保准你乐在其中！</span><br/></p><p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; caret-color: rgb(160, 160, 160); color: rgb(160, 160, 160); fo