(3, '四校王者荣耀', '/uploads/attachment/20210330/21471503af1a6022f839d49b854dba18.jpg', '澳洲四校王者荣耀对抗赛！圆电竞梦！', '<p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(51, 51, 51); color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; letter-spacing: 1px; text-align: center; word-wrap: break-word !important;\"><span style=\"font-size: 15px;\"><br/></span></p><p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(51, 51, 51); color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; letter-spacing: 1px; word-wrap: break-word !important;\"><span style=\"font-size: 15px;\">蒙纳士大学，悉尼大学，首都地区，新南威尔士大学四个学联联合主办的线上王者荣耀对抗赛。新的一学期已经来临，不知道你准备好没有？</span><span style=\"font-size: 15px; text-align: center;\">或许你还坚守在澳洲，亦或者你留守在国内。</span><span style=\"font-size: 15px; text-align: center;\">无论如何，</span><span style=\"font-size: 15px; text-align: center;\">相信你很期待一个集体活动</span><span style=\"font-size: 15px; text-align: center;\">让大家再次重聚在一起。</span></p><p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(51, 51, 51); color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; letter-spacing: 1px; word-wrap: break-word !important;\"><spa