(7, '【MCSA鸿蒙之声】专栏全新上线 五月刊火热征稿中', '/uploads/attachment/20210525/035100e56c3162d329462c85ad375712.png', 'MCSA鸿蒙之声专栏意在为喜爱文字、摄影、视频等创作的蒙纳士学子们提供分享交流的平台。专栏由蒙纳士学生自己编写，所有作品均由学生原创。每月更新一个主题，优秀的投稿作品将有机会在MCSA公众号、ins、抖音、B站等各大平台发布，展现蒙纳士学子们最真实的生活、思想和精神面貌。', '<p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(95, 95, 95); color: rgb(95, 95, 95); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 1.7999999523162842px; -webkit-text-size-adjust: 100%; word-wrap: break-word !important;\">投稿稿件可以三种形式发布：</p><p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(95, 95, 95); color: rgb(95, 95, 95); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 1.7999999523162842px; -webkit-text-size-adjust: 100%; word-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(249, 110, 87); word-wrap: break-word !important;\">文章、摄影集、视频作品</span></strong>。<br/></p><p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(95, 95, 95); color: rgb(95, 95, 95); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 1.7999999523162842px; -webkit-text-size-adjust: 100%; word-wrap: break-word !important;\">所有作品应展现留学生积极向上的健康生活态度，</p><p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(95, 95, 95); color: rgb(95, 95, 95); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 1.7999999523162842px; -webkit-text-size-adjust: 100%; word-wrap: break-word !important;\">并由投稿者原创完成。</p><p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(95, 95, 95); color: rgb(95, 95, 95); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 1.7999999523162842px; -webkit-text-size-adjust: 100%; word-wrap: break-word !important;\">MCSA将审查作者提交的作品内容，</p><p style=\"white-space: normal; margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; caret-color: rgb(95, 95, 95); color: rgb(95, 95, 95); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 1.7999999523162842px; -webkit-text-size-adjust: 100%; word-wrap: break-word !important;\">如有必要，会与作者协商修改。</p><p><br/></p><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 16px; color: rgb(249, 110, 87); word-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">作品提交方式</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; letter-spacing: 1.8px; word-wrap: break-word !important;\">扫码添加MCSA小助手7号，将作品预览、姓名（笔名）发送给小助手，初审通过后会与你进一步联系发表细节哦。</span><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; word-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; word-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">征稿时间：</strong>即日起至2021年5月20</p></section></section><p><section><section></section></section></p>', '1', '0', 1621926436, 1621926436, 0),
