0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p></section></section></section></section><p><br/></p><section><section><section><p style=\"text-align:center\"><br/></p><p><br/></p><p><br/></p></section></section></section><p><br/></p><p><br/></p>', '1', '0', 1629011902, 1629011902, 0),
(14, '【MCSA迎新会】线下迎新会，快来认识你的新朋友！', '/uploads/attachment/20210815/f91b6d903e0f4c2957120dc7cc076691.png', '蒙纳士新生们：\r\n\r\n你好！\r\n蒙纳士中国学生会（MCSA）将于7月24日（周六）在广东深圳举行线下迎新会，诚挚邀请蒙纳士大学学生前来参加。此次迎新会将有来自各专业的学长学姐分享学习心得，讲解校园相关政策及知识，同时，我们给予充分的社交机会和活动时间，期待给你的大学之行一个精彩的开始！特此发出诚挚邀请，期待你的光临！\r\n\r\n', '<section><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">活动详情</strong></p></section></section></section><section><section><section></section></section></section></section></section></section><p><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">1</strong></span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">.</strong></p></section></section><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">迎新会介绍</strong></p></section></section></section></section><section><section><section><section><section></section></section></section></section></section></section></section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\">蒙纳士中国学生会<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; text-decoration-line: underline; overflow-wrap: break-word !important;\">第一届国内线下新生会</span>，主旨是为由于疫情无法前往澳洲的蒙纳士大学学生们开设一场线下迎新会，通过<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; text-decoration-line: underline; overflow-wrap: break-word !important;\">学长学姐交流、游戏活动</span>等方式，让新生们了解学校、专业内容、并充分社交，收获志同道合的伙伴。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">新生老生都可以参加！</strong></p></section></section></section></section></section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">2</strong></span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">.</strong></p></section></section><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">迎新会时间</strong></p></section></section></section></section><section><section><section><section><section></section></section></section></section></section></section></section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 14px; color: rgb(108, 77, 45);\">2021年7月24日 14:00~18:00</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 14px; color: rgb(108, 77, 45);\">请提前半小时入场签到</span></p></section></section></section></section></section><section><section><section><section></section></section></section></section></p><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">3</strong></span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">.</strong></p></section></section><p><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">迎新会地址</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><img width=\"30px\" src=\"https://mmbiz.qpic.cn/sz_mmbiz_png/VM3PHicicXAYAo1J3M9eVYRFMz3xFfDFQWn3ZdjZ4jMG7BSGZpaV94mqiaRV59PMVpyy7Q7llyRicsFT6BDXKtp7icg/640?wx_fmt=png&tp=webp&wxfrom=5&wx_lazy=1&wx_co=1\" alt=\"图片\"/><span style=\"color: rgb(51, 51, 51); font-family: -apple-system, system-ui, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; letter-spacing: 0.544px; background-color: rgb(255, 249, 241);\">&nbsp;</span></strong></p><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\">深圳彭年万丽酒店（桂花厅）嘉宾路2002号，4楼</p></section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"></strong><br/></p></section></section></section></section></section></p><p><br/></p>', '1', '1', 1629011933, 1629012247, 0);
