(15, '前途迷茫，MCSA为你导航｜MCSA 线上Q&A Workshop邀请函', '/uploads/attachment/20210816/ebc396ae1e1578699700437dc51f73a4.png', '2021 S2已经不知不觉的到来了，为了让大家更好的融入大学生活，顺利开启新学期，我们MCSA将举办线上答疑解惑Workshop！', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em; overflow-wrap: break-word !important;\">在国际疫情仍然没有得到完全控制的今天，大家分隔大洋。这对于同学们特别是新生来说，想要快速适应新学期的学习生活变得不容易。比如不知道如何选课，不知道如何结交到新朋友，对my monash网站功能不熟悉，以及如何有机会在国内大学上课还能获得学分等等……</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em; overflow-wrap: break-word !important;\">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em; overflow-wrap: break-word !important;\">你是否也经历过学校电话打不通，邮件迟迟没有回复，不知道找谁寻求帮助……所以！一个人孤军奋战还不如来参加我们的Workshop。你的问题在Workshop中都会被一一解答！同时在活动中有机会获得现金红包和礼品！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system, system-ui, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: 0.544px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em; overflow-wrap: break-word !important;\"><br/></p><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">活动信息</strong></p></section></section></section><section><section><section><section><section></section></section></section></section></section></section></section><p><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">&nbsp; &nbsp; &nbsp; &nbsp;活动日期&nbsp;&nbsp;&nbsp;&nbsp;</strong><span style=\"font-size: 15px;\">2021年8月7日（周六）</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">活动时间&nbsp; &nbsp; &nbsp;</strong>北京时间14:00，</p></section></section></section></section></section><section><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;墨尔本时间16:00开始</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">活动地点&nbsp;&nbsp;&nbsp;&nbsp;</strong><span style=\"text-align: center;\">Zoom线上直播间</span></p></section></section></section></section></section></section></p><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">报名方式</strong></p></section></section></section><section><section><section><section><section></section></section></section></section></section></section></section><p><section><section><section><section><section><section><section><section></section></section></section></section></section><section><section><section><section><section></section></section></section></section></section></section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">扫描二维码&nbsp;&nbsp;&nbsp;&nbsp;</strong>添加MCSA新生小助手报名~</p></section></section><section><section><section><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/yOYhOwIzakQu69icAzznu2AkF406xyicGr5c8s6BC9c5gm868OVIUcJnQVk6XYl40pOxGOZQnsib57U9SVt4fwtIw/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1&wx_co=1\" alt=\"图片\" width=\"359\" height=\"357\"/></section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-indent: 2em; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 14px;\">在活动开始前，为了更加全面的了解困扰着同学们的问题和给到大家更精确的解答，欢迎大家将困扰你的问题发送给小助手们！</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p></section><br/></section></section></section></section></section></section></section></p>', '1', '0', 1629109875, 1629353587, 0),
(16, '【MCSA推理节】高校命案，谜团揭晓时刻！', '/uploads/attachment/20210816/15323ec5108503cb9100e5686b35b3be.jpg', '考试结束，一场命案，四名嫌疑人，警方对此案无能为力。年轻的侦探，你们是否有信心准备好去侦破此案呢？快邀请你的其他侦探小伙伴来组建一支五人侦探队伍，若人数不够，可联系警方匹配其他队友！', '<section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">案发真相</strong></p></section></section><section><section></section></section></section></section><p></p><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">尊敬的侦探，您好</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">&nbsp;</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">首先，想对所有前来参与调查的侦探表示诚挚的感谢，谢谢你们对于此次案件的全力参与和调查。如今，杀害知名教授甄鲍紫的凶手已经抓捕归案，校园也逐渐恢复了往日的宁静。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">在四名嫌疑人中，经过推理得出该高校机械专业的学生张雨琪就是此案的凶手，案发当晚，她在家中杀害了甄鲍紫教授。</span></strong></p></section><p></p><p><br/></p><p style=\"text-align:center\"><img src=\"https://mmbiz.qpic.cn/mmbiz_png/yOYhOwIzakTP8vKMtOy2pQbooCVsIPPsKhT1cdoeV4mUyucSxIuVHVPwwdice4NC5ehDulx4wujspctsLqicQN3g/640?wx_fmt=png&tp=webp&wxfrom=5&wx_lazy=1&wx_co=1\" alt=\"Image\" width=\"359\" height=\"549\"/></p><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 12px; letter-spacing: 0.544px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">案发当晚，张雨琪在甄鲍紫家打开煤气开关后和甄鲍紫离开。随后，躲在卧室床下的郭提娜爬起来剪断了电表箱的保险丝，并在安放土制炸弹后悄然离去。18:30，甄鲍紫回到家中，一股浓烈的煤气味弥漫在整个家中。他下意识开灯，但是由于电表箱的保险丝已经被郭提娜剪断，家中断电，甄鲍紫不得不掏出手机打开手电筒照明。在打开手机手电筒的一瞬间，手机内部电路产生的电火花引爆了家中弥漫的煤气。手机作为引爆的中心被炸碎，甄鲍紫被瞬间炸死，持着手机的右手和看着手机的头部被爆炸损伤的最严重。紧接着，爆炸的冲击波传到电表箱内，引爆了电表箱中的炸弹，电表箱中的炸弹发出第二次巨响并爆炸，炸碎了隐形摄像机并炸掉了电表箱的门（电表箱的门向内凹陷，说明外部爆炸先产生）。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 12px; letter-spacing: 0.544px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">&nbsp;</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 12px; letter-spacing: 0.544px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">韩斯丁的雇凶杀人的汇款被龙坤坤拦截，所以雇凶杀人并没有成功；而龙坤坤虽然投毒成功，但投毒剂量远远不到致死量，且甄鲍紫感觉水有怪味没有喝下；郭提娜虽然安装了炸弹，但炸弹引发的爆炸并不是甄鲍紫的死因。</span></strong></p><p><br/></p><p style=\"text-align:center\"><img src=\"https://mmbiz.qpic.cn/mmbiz_png/yOYhOwIzakTP8vKMtOy2pQbooCVsIPPstGzrCPny5P4mrS7YvYsPy3Evp595x0efJYWbz4NPAFrkDgaiaT1G2bg/640?wx_fmt=png&tp=webp&wxfrom=5&wx_lazy=1&wx_co=1\" alt=\"Image\" width=\"487\" height=\"381\"/></p><p><br/></p><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">▲ 关键线索指向</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">&nbsp;</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">①尸体信息1</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">——死者尸体位置</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">尸体位于玄关，而非电表箱所在的卧室，说明甄并非死于郭安装的炸弹。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">&nbsp;</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">②尸体信息2</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">——尸体右侧手臂和头部整体被炸碎，其他部分的炸毁程度也很高。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">尸身不同部分被炸伤的程度有所不同，距离爆炸源（手机）最近的右手和头部被炸碎。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">&nbsp;</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">③尸体高级线索</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">——甄鲍紫的手机被炸成了碎片，散落在尸体四周。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">如果是受到外部爆炸冲击，手机的零件应该散落在尸体的某一个方向，而并非向四周散开，这侧面说明了手机是爆炸源。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">&nbsp;</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">④卧室/卫生间高级线索</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">——电表箱的门向电表箱内部凹陷，但掉落在电表箱外卧室的地上。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">这证明了电表箱中的炸弹是从外部被引爆，箱门向内凹陷说明先受到外部冲击，箱门掉落在地是内部炸弹爆炸之后冲击的结果。另外，郭曾说过土制炸弹威力不大，因此箱门在第一次煤气大爆炸之后产生松动，在第二次土制炸弹爆炸后受到冲击飞出去。</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">&nbsp;</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">线索的详细解答</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px; color: rgb(0, 0, 0);\">请各位侦探联系dobby430</span></strong></p></section><p></p><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p></section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-family: PingFangSC-light;\">MCSA官方警队-墨尔本分队&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: right; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box;