(17, '校友分享 | 揭秘双学位学姐如何毕业后取得 Top 3 律所 Offer', '/uploads/attachment/20210823/aa78a383ecd2fb1a0d6c4bd4ba8cce3d.bmp', '大家好，欢迎来到MCSA校友会毕业\r\n\r\n校友访谈专栏。本期采访我们有幸邀\r\n\r\n请到了曾在Monash大学法学和文学\r\n\r\n双学位毕业的优秀校友Lynette为我们\r\n\r\n分享她学习和就职后的心得体会。', '<p style=\"text-align: center;\"><span style=\"color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; text-align: center; background-color: rgb(255, 255, 255);\"># MCSA 校友会 #</span><br/></p><p><br/></p><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\">MONASH CHINESE STUDENT ASSOCIATION</p></section></section></section><p><br/></p><section><section></section></section><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(224, 137, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 12px; letter-spacing: 2px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\">大家好，欢迎来到MCSA校友会毕业</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\">校友访谈专栏。本期采访我们有幸邀</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\">请到了曾在Monash大学法学和文学</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\">双学位毕业的优秀校友Lynette为我们</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\">分享她学习和就职后的心得体会。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !