ans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 12px; letter-spacing: 2px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><span style=\"color: rgb(255, 192, 0); font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(232, 168, 109); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 2px; text-align: justify; white-space: normal; background-color: rgb(255, 248, 241); overflow-wrap: break-word !important;\"></strong></strong></span></p><section><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 40px; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">#Q1</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 24px; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">Have these two degrees been helpful for your work?</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"color: rgb(79, 97, 40);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 15px; overflow-wrap: break-word !important;\">选择学习双学位对你的工作有帮助吗？</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; font-size: 15px; overflow-wrap: break-word !important;\"><br/></p></section></section></section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">I chose to study for a double degree because I knew that I wanted to do Arts. In high school I always liked English and I enjoy literature in particular. And for law, I thought it would be good to do two degrees because then I can have broader study opportunities and experience, and also broader career opportunities too.&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: justify; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">我选择攻读双学位是因为我知道我想学文学。在高中我一直喜欢英语，尤其喜欢文学。对于法律，我认为攻读两个学位很好，因为这样我可以有更广泛的学习机会和经验，也有更广泛的职业机会。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">The two degrees are similar. You need to read and write. You need to write clearly and analyse information and so literature I analyse like books and films and kind of things. For law it was cases and the legislation so I suppose they complimented each other and so now when I work, I do a lot of the same things I do lots of reading and writing, and analysis. So it relates to each other.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">这两个专业是相似的，都需要读和写的能力。你需要逻辑清晰，分析信息，所以我平时分析书籍、电影之类的文学作品。对于法律来说，就是案例和立法，我认为它们是相互联系的，所以现在当我工作的时候，我做很多阅读，写作和分析，而它们是相互关联的。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><br/></p><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40);\"><span style=\"color: rgb(79, 97, 40); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 40px; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"># Q2&nbsp;</strong></span><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 44px; overflow-wrap: break-word !important;\">&nbsp;&nbsp;&nbsp;</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">Could you please share some of your learning skills while studying?</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 15px; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">可以为我们分享你在学习方面的学习技巧吗？</strong></span></p></section></section></section><p><br/></p><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">I think especially for the law I found it was important to revise during the semester. Every time after we finished the topic that weekend I tried to prepare my exam notes for that topic while it’s in my memory. And then at the end of 12 weeks, I can do practising exams and I already have notes for that. So I don’t have to do revision then so that was really important for me.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">我认为特别是对于法律，在学期中复习是很重要的。每次我们讲完每周的内容之后，我都试着在记忆中准备这个话题的考试笔记。在12周结束之后，我可以做练习题。因为我已经有笔记了，所以我不需要做重复的事情，这对我来说很重要。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">I&#39;m also a bit old school,&nbsp; I like handwriting notes. And I find that it means that when you’re listening, you’re actually already summarizing in your head. So you’re already processing the information and then you write it down.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">我也有点老派，我喜欢手写笔记。我发现这意味着当你倾听的时候，其实你已经在脑子里总结了。所以你已经在处理信息了，然后你把它写下来。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><br/></span></p></section></section><section><section><section></section></section></section><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; text-align: justify; white-space: normal; background-color: rgb(253, 246, 236); overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 40px; overflow-wrap: break-word !important;\"># Q3</span></strong><br/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); font-size: 16px; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; white-space: normal; background-color: rgb(253, 246, 236); overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">How do you feel about learning in different countries (exchange program in UK)?</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"color: rgb(79, 97, 40); font-family: Optima-Regular, PingFangTC-light; letter-spacing: 0.544px; background-color: rgb(255, 255, 255); font-size: 16px;\"><strong>你觉得在不同国家学习（英国的交换生项目）的感觉怎么样？</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); font-family: Optima-Regular, PingFangTC-light; letter-spacing: 0.544px; background-color: rgb(255, 255, 255); font-size: 16px;\"><strong><br/></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"color: rgb(79, 97, 40); font-family: Optima-Regular, PingFangTC-light; letter-spacing: 0.544px; background-color: rgb(255, 255, 255); font-size: 16px;\"><strong><img src=\"/uploads/ueditor/20210823/7986fcb077a41c0804ac007aaf1a251a.PNG\" title=\"7986fcb077a41c0804ac007aaf1a251a.PNG\" alt=\"7986fcb077a41c0804ac007aaf1a251a.PNG\" width=\"756\" height=\"582\"/></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; background-color: rgb(255, 255, 255); color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; white-space: normal; background-color: rgb(253, 246, 236); overflow-wrap: break-word !important;\"><span style=\"background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 24px; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; text-align: justify; white-space: normal; background-color: rgb(253, 246, 236); overflow-wrap: break-word !important;\"><span style=\"background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 15px; overflow-wrap: break-word !important;\"></span></strong></span></strong></span></p><section><section><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">It was fun – quite relaxing, as I didn’t have any law subjects and didn’t have to balance study with work or other commitments. I enjoyed getting to travel and explore the UK and Europe. I think there are different benefits to learning overseas, depending on what you want.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">在不同国家学习生活很有趣并且非常放松，因为我没有任何法律课程且当时大多数是文学课程，也不需要平衡学习和工作或其他义务。当时很享受在英国与欧洲大陆的旅行。我认为在海外学习有不同的好处，这取决于你想要什么。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">For example, some people go to a non-English speaking country to improve language skills. I think it took me out of my comfort zone, so I had the courage to try new things/activities that I wouldn’t do if I stayed in Melbourne.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; text-align: right; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">比如，有些人去非英语国家提高语言技能。而它让我走出了自己的舒适区，所以我有勇气尝试新的事情和活动，如果我留在墨尔本的话我是不会做这些的。</span></p></section></section><section><section><section><section></section></section></section></section></section></section></section><p><br/></p><section><section><section><section><section><section></section></section></section></section></section></section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\">Career Planning</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\">职业规划</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\"><br/></span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\"><video class=\"edui-upload-video  vjs-default-skin   video-js\" controls=\"\" preload=\"none\" width=\"420\" height=\"280\" src data-setup=\"{}\"></video></span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\"></span></strong></p><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"color: rgb(79, 97, 40);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 40px; overflow-wrap: break-word !important;\">#Q4</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 24px; overflow-wrap: break-word !important;\">In your process of becoming a lawyer, what difficulties did you encounter and how did you solve them?</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"color: rgb(79, 97, 40);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 15px; overflow-wrap: break-word !important;\">在你成为一名律师的过程中，你遇到过哪些困难，又是如何解决的?</span></strong></span></p></section></section></section><p><br/></p><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">Clerkship process&nbsp; – get to know different law firms through networking and interview process; work experience (during uni); mentoring programs at uni (connecting with someone in the industry, to help give advice and review my CV, etc.); getting involved in activities at uni (competitions, law review).</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; text-align: left; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">找实习和工作挺难的，通过networking社交和面试过程了解不同的律师事务所；在校期间的工作经验；大学的指导项目(与业内人士联系，帮助给出建议，审阅我的简历等)；参与校内活动(竞赛、法律评论)。</span></p></section></section><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\"><br/></span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\"></span></strong></p><section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"color: rgb(79, 97, 40);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 40px; overflow-wrap: break-word !important;\">#Q5&nbsp;</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 24px; overflow-wrap: break-word !important;\">Could you please introduce something about your work, and how to become a qualified lawyer in Australia?</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 15px; overflow-wrap: break-word !important;\">你能介绍一下你的工作情况，以及如何在澳大利亚成为一名合格的律师吗?</span></strong></span></p></section></section></section><p><br/></p><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">The process of being a qualified lawyer is that you would need to get a law degree in Australia and so that’s the first part. Then you need to go through an extra diploma just for some studies of practical legal training. And then you can get a certificate from the court. So that’s how I did my undergraduate degree in law. At the end of last year, I got admitted as a lawyer. That’s the general process.&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">要想成为一名合格的律师，你首先需要在澳大利亚获得法律学位。然后你需要通过一个额外的文凭，其中有一些实践法律培训的学习。然后你就可以拿到法庭的证明了。这便是我去年底拿到法律资格证的过程，也是正常的过程。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">You definitely involve getting work experience in the university which leads to the job hiring part which is a hard part and so there’s something called the clerkship process. A clerkship is an internship, maybe three to four weeks in a law firm and you get to do a little bit of work experience. But really it’s like an interview because they can see how you work and then if they are happy with you then they might offer you a job.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">你肯定会在大学里获得工作经验与工作招聘的部分，这其实是一个困难的部分，所以有一种叫做见习生过程。见习生的职位是一种实习，可能在一家律师事务所工作三到四个星期，你可以积累一点工作经验。但实际上，这就像面试，因为他们可以看到你的工作方式，如果他们对你满意，他们可能会给你一份工作。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">In Victoria you are either a solicitor or a barrister. Solicitor is just average lawyer. Who gives advice to who helps prepare legal documents.A barrister is that someone who specializes in appearing in court. So when you have a court matter, they’re trained to or supposed to speak to the judge, on their client’s behalf. You have to do extra training to be a barrister. After becoming a solicitor, with another exam and training.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: left; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; overflow-wrap: break-word !important;\">在维洲，身为一名律师，你要么是一名（初级）事务律师或是一名出庭律师，即是平常、普通的，提供法律指导的律师, 他们帮助准备法律相关的文件; 出庭律师则专门从事在法庭上出席。所以，当你有很多与法庭相关的事务时, 出庭律师是经过专业训练与法官进行沟通的。如果你想注册成为一名出庭律师，需要先成为一名事务律师，这之后，你还需要经过额外的考试与训练学习。</span></p></section></section><section><section><section></section></section></section><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\"><br/></span></strong><strong style=\"color: rgb(79, 97, 40); text-align: center; white-space: normal; margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 40px; overflow-wrap: break-word !important;\">#Q6</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><span style=\"background-color: rgb(255, 255, 255);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; white-space: normal; background-color: rgb(253, 246, 236); overflow-wrap: break-word !important;\"><span style=\"background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 24px; overflow-wrap: break-word !important;\">What do you think you have gained during your internship?</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\">你在实习的过程中收获了什么？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; white-space: normal; background-color: rgb(253, 246, 236); overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 24px; overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; text-align: justify; white-space: normal; background-color: rgb(253, 246, 236); overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 15px; overflow-wrap: break-word !important;\"><br/></span></strong></span></strong></span><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 22px; letter-spacing: 0.544px; white-space: normal; background-color: rgb(253, 246, 236); overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40); background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; font-size: 24px; overflow-wrap: break-word !important;\"><img src=\"/uploads/ueditor/20210823/5149da9b1501723cc984fa23a4b4bd44.PNG\" title=\"5149da9b1501723cc984fa23a4b4bd44.PNG\" alt=\"5149da9b1501723cc984fa23a4b4bd44.PNG\" width=\"798\" height=\"605\"/></span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><br/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><br/></span></p></section><section><section><section><section></section></section></section></section></section></section></section><section><section><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40);\">I did two internships so one was at another law firm and one with where I work now. I think it prepared me by helping me to learn a bit about the different types of law firms.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: justify; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">我做过两次实习，一次是在另一家律师事务所，另一次是在我现在工作的地方。我认为它帮助我了解了一些不同类型的律师事务所，为我做好了准备。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: justify; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40);\">The first one that I did was at one of the bigger firms in Australia. There might be about five to seven big firms and I think that one was quite interesting. I got to learn about just how the company works inside like you get to see the day-to-day work of the lawyer and you see the work-life balance a little bit. You kind of see what time they start work, what time they finish work, whether they eat lunch. I somehow just don’t see them eating lunch and I was like that’s not healthy. I think it prepared me by helping me to learn a bit about this industry. Because at university you don&#39;t see that very much you just study. But you don’t see the workplace.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: justify; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">我做的第一个是在澳大利亚的一家大公司。澳洲大概有5到7家大公司。通过实习我开始了解公司内部是如何运作的，比如律师的日常工作，看到了工作与生活的平衡。你可以看到他们什么时候开始工作，什么时候结束工作，有没有吃午饭。有时候我真的看见他们不吃午饭，那不健康。我认为它帮助我学习了一些关于这个行业的知识。因为在大学里你只会学习，但你看不到工作场所。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: justify; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(79, 97, 40);\">And then another thing was that I could learn about different areas of law. I think as a lawyer you work in different fields so you don’t just do everything. Some people will like to do criminal law about crimes.You can either work for the prosecution or the defenc. You can do commercial law which is like property law which do for companies with businesses. You can do government-related law, which is what I do, so advise the government on what the laws that they wrote actually allow them to do. Or you can do community legal centers and like working for charities and that kind of thing. You could also work for in-house, which is like you work for a company like say a bank but you’re part of the legal team in that bank, helping give legal advice to that company.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: justify; overflow-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; text-align: center; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\">通过实习，我了解到法律专业的不同领域与方向。作为一名律师，你可以在不同的领域进行从事工作。比如，有些人会选择刑法，或者和犯罪相关的，你既能帮助起诉方或者帮助被告方打官司。你也能选择做商品法，比如物权法给公司处理商业相关的，或者和我一样，从事与政府相关的法律，我的工作就是给政府进行法律建议，他们政府通过的法律能够真正让他们去做的一些事情。也可以从事社区援助中心、慈善机构等，进行法律帮助等相关工作，当然你也可以成为一名法律顾问，比如在一个公司、银行中，身为该银行，法律团队中的一员，给公司提供一些法律提议。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; overflow-wrap: break-word !important; text-align: center;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(79, 97, 40); overflow-wrap: break-word !important;\"><br/></span></p></section></section><p><br/></p><section><section><section></section></section></section><p><br/></p><section><section><section><section><section><section><section><section><section><section></section></section></section></section></section></section></section></section></section></section><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; min-height: 1em; color: rgb(224, 137, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 12px; letter-spacing: 2px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; overflow-wrap: break-word !important;\"><span style=\"color: rgb(255, 192, 0); font-size: 16px;\"></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\">Relationship between learning and working</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\">学习和工作的联系</span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\"><br/></span></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important; font-size: 30px;\"><video class=\"edui-upload-video  vjs-default-skin  video-js\" controls=\"\" preload=\"none\" width=\"420\" height=\"280\" src data-setup=\"{}\"></video></span></strong></p><p>&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(79, 103, 78); font-family: Optima-Regular, PingFangTC-light; font-size: 15px; letter-spacing: 1px; white-space: normal; background-c &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>', '1', '0', 1629544501, 1629697265, 0);
